## –ú–∞—Å—Å–∏–≤–æ–ø–æ–¥–æ–±–Ω—ã–µ readonly —Ç–∏–ø—ã (–º–æ–¥–∏—Ñ–∏—Ü–∏—Ä–æ–≤–∞—Ç—å –Ω–µ–ø–æ—Å—Ä–µ–¥—Å—Ç–≤–µ–Ω–Ω–æ –≤ –∞–Ω–Ω–æ—Ç–∞—Ü–∏–∏ —Ç–∏–ø–∞)

_TypeScript_ —Ä–µ–∞–ª–∏–∑—É–µ—Ç –º–µ—Ö–∞–Ω–∏–∑–º –ø–æ–∑–≤–æ–ª—è—é—â–∏–π –æ–ø—Ä–µ–¥–µ–ª—è—Ç—å –º–∞—Å—Å–∏–≤—ã –∏ –∫–æ—Ä—Ç–µ–∂–∏, –∫–∞–∫ –Ω–µ–∏–∑–º–µ–Ω—è–µ–º—ã–µ —Å—Ç—Ä—É–∫—Ç—É—Ä—ã –¥–∞–Ω–Ω—ã—Ö. –î–ª—è —ç—Ç–æ–≥–æ –∫ —Ç–∏–ø—É —É–∫–∞–∑–∞–Ω–Ω–æ–º—É –≤ –∞–Ω–Ω–æ—Ç–∞—Ü–∏–∏ —Ç–∏–ø–∞ –¥–æ–±–∞–≤–ª—è–µ—Ç—Å—è –º–æ–¥–∏—Ñ–∏–∫–∞—Ç–æ—Ä `readonly`.

`````ts
let array: readonly string[] = ['Kent', 'Clark']; // –ú–∞—Å—Å–∏–≤
let tuple: readonly [string, string] = ['Kent', 'Clark']; // –ö–æ—Ä—Ç–µ–∂
`````

–≠–ª–µ–º–µ–Ω—Ç—ã –º–∞—Å—Å–∏–≤–æ–ø–æ–¥–æ–±–Ω—ã—Ö —Å—Ç—Ä—É–∫—Ç—É—Ä, –æ–ø—Ä–µ–¥–µ–ª–µ–Ω–Ω—ã—Ö –∫–∞–∫ `readonly`, –Ω–µ–≤–æ–∑–º–æ–∂–Ω–æ –∑–∞–º–µ–Ω–∏—Ç—å –∏–ª–∏ —É–¥–∞–ª–∏—Ç—å. –ö—Ä–æ–º–µ —Ç–æ–≥–æ, –≤ –ø–æ–¥–æ–±–Ω—ã–µ —Å—Ç—Ä—É–∫—Ç—É—Ä—ã –Ω–µ–≤–æ–∑–º–æ–∂–Ω–æ –¥–æ–±–∞–≤–∏—Ç—å –Ω–æ–≤—ã–µ —ç–ª–µ–º–µ–Ω—Ç—ã. –ò–Ω—ã–º–∏ —Å–ª–æ–≤–∞–º–∏, —É –º–∞—Å—Å–∏–≤–æ–ø–æ–¥–æ–±–Ω—ã—Ö `readonly` —Ç–∏–ø–æ–≤ –æ—Ç—Å—É—Ç—Å—Ç–≤—É—é—Ç –ø—Ä–∏–∑–Ω–∞–∫–∏ –ø—Ä–µ–¥–Ω–∞–∑–Ω–∞—á–µ–Ω–Ω—ã–µ –¥–ª—è –∏–∑–º–µ–Ω–µ–Ω–∏—è –∏—Ö —Å–æ–¥–µ—Ä–∂–∏–º–æ–≥–æ.

–í —Å–ª—É—á–∞–µ –æ–±—ä—è–≤–ª–µ–Ω–∏—è `readonly` –º–∞—Å—Å–∏–≤–∞ —Å—Ç–∞–Ω–æ–≤–∏—Ç—Å—è –Ω–µ–≤–æ–∑–º–æ–∂–Ω–æ –∏–∑–º–µ–Ω–∏—Ç—å –µ–≥–æ —ç–ª–µ–º–µ–Ω—Ç—ã —Å –ø–æ–º–æ—â—å—é –∏–Ω–¥–µ–∫—Å–Ω–æ–π —Å–∏–≥–Ω–∞—Ç—É—Ä—ã (`array[...]`) 

`````ts
let array: readonly string[] = ['Kent', 'Clark']; // –ú–∞—Å—Å–∏–≤
array[0] = 'Wayne'; // Error, -> Index signature in type 'readonly string[]' only permits reading.
array[array.length] = 'Batman'; // Error ->  Index signature in type 'readonly string[]' only permits reading.
`````

–ü–æ–º–∏–º–æ —ç—Ç–æ–≥–æ, —É `readonly` –º–∞—Å—Å–∏–≤–∞ –æ—Ç—Å—É—Ç—Å—Ç–≤—É—é—Ç –º–µ—Ç–æ–¥—ã, —Å –ø–æ–º–æ—â—å—é –∫–æ—Ç–æ—Ä—ã—Ö –º–æ–∂–Ω–æ –∏–∑–º–µ–Ω–∏—Ç—å —ç–ª–µ–º–µ–Ω—Ç—ã –º–∞—Å—Å–∏–≤–∞.

`````ts
let array: readonly string[] = ['Kent', 'Clark'];
array.push('Batman'); // Error ->  Property 'push' does not exist on type 'readonly string[]'.
array.shift(); // Error -> Property 'shift' does not exist on type 'readonly string[]'.

array.indexOf('Kent'); // Ok
array.map(item => item); // Ok
`````

–° —É—á–µ—Ç–æ–º –ø–æ–≥—Ä–µ—à–Ω–æ—Å—Ç–∏ –Ω–∞ –∏–∑–≤–µ—Å—Ç–Ω—ã–µ —Ä–∞–∑–ª–∏—á–∏—è –º–µ–∂–¥—É –º–∞—Å—Å–∏–≤–æ–º –∏ –∫–æ—Ä—Ç–µ–∂–µ–º, —Å–ø—Ä–∞–≤–µ–¥–ª–∏–≤–æ —É—Ç–≤–µ—Ä–∂–¥–∞—Ç—å, —á—Ç–æ –ø—Ä–∞–≤–∏–ª–∞ –¥–ª—è `readonly` –º–∞—Å—Å–∏–≤–∞ —Å–ø—Ä–∞–≤–µ–¥–ª–∏–≤—ã –∏ –¥–ª—è `readonly` –∫–æ—Ä—Ç–µ–∂–∞. –ü–æ–º–∏–º–æ —Ç–æ–≥–æ, —á—Ç–æ –Ω–µ–≤–æ–∑–º–æ–∂–Ω–æ –∏–∑–º–µ–Ω–∏—Ç—å –∏–ª–∏ —É–¥–∞–ª–∏—Ç—å —Å–ª–æ—Ç—ã –∫–æ—Ä—Ç–µ–∂–∞, –æ–Ω —Ç–∞–∫–∂–µ —Ç–µ—Ä—è–µ—Ç –ø—Ä–∏–∑–Ω–∞–∫–∏ –º–∞—Å—Å–∏–≤–∞, –∫–æ—Ç–æ—Ä—ã–µ —Å–ø–æ—Å–æ–±–Ω—ã –ø—Ä–∏–≤–µ—Å—Ç–∏ –∫ –µ–≥–æ –∏–∑–º–µ–Ω–µ–Ω–∏—é.

`````ts
let tuple: readonly [string, string] = ['Kent', 'Clark'];
tuple[0] = 'Wayne'; // Error -> Cannot assign to '0' because it is a read-only property.

tuple.push('Batman'); // Error -> Property 'push' does not exist on type 'readonly [string, string]'.
tuple.shift(); // Error -> Property 'shift' does not exist on type 'readonly [string, string]'.

tuple.indexOf('Kent'); // Ok
tuple.map(item => item); // Ok
`````


–¢–∞–∫–∂–µ –Ω–µ –±—É–¥–µ—Ç –ª–∏—à–Ω–∏–º —É–ø–æ–º—è–Ω—É—Ç—å, —á—Ç–æ –º–∞—Å—Å–∏–≤ –∏–ª–∏ –∫–æ—Ä—Ç–µ–∂ —É–∫–∞–∑–∞–Ω–Ω—ã–π –≤ –∞–Ω–Ω–æ—Ç–∞—Ü–∏–∏ —Å –ø–æ–º–æ—â—å—é —Ä–∞—Å—à–∏—Ä–µ–Ω–Ω–æ–≥–æ —Ç–∏–ø–∞ `Readonly<T>`, —Ä–∞—Å—Ü–µ–Ω–∏–≤–∞–µ—Ç—Å—è –≤—ã–≤–æ–¥–æ–º —Ç–∏–ø–æ–≤ –∫–∞–∫ –ø–æ–º–µ—á–µ–Ω–Ω—ã–π –º–æ–¥–∏—Ñ–∏–∫–∞—Ç–æ—Ä–æ–º `readonly`.

`````ts
// type A = readonly number[];
type A = Readonly<number[]>;

// type B = readonly [string, boolean];
type B = Readonly<[string, boolean]>;
`````

–ë–ª–∞–≥–æ–¥–∞—Ä—è –¥–∞–Ω–Ω–æ–º—É –º–µ—Ö–∞–Ω–∏–∑–º—É –≤ —Å–æ—á–µ—Ç–∞–Ω–∏–∏ —Å –º–µ—Ö–∞–Ω–∏–∑–º–æ–º –º–Ω–æ–∂–µ—Å—Ç–≤–µ–Ω–Ω–æ–≥–æ —Ä–∞—Å–ø—Ä–æ—Å—Ç—Ä–∞–Ω–µ–Ω–∏—è (`spread`), —Å—Ç–∞–Ω–æ–≤–∏—Ç—Å—è –≤–æ–∑–º–æ–∂–Ω—ã–º —Ç–∏–ø–∏–∑–∏—Ä–æ–≤–∞—Ç—å —Å–ª–æ–∂–Ω—ã–µ —Å—Ü–µ–Ω–∞—Ä–∏–∏, –æ–¥–Ω–∏–º –∏–∑ –∫–æ—Ç–æ—Ä—ã—Ö —è–≤–ª—è–µ—Ç—Å—è —Ä–µ–∞–ª–∏–∑–∞—Ü–∏—è –∏–∑–≤–µ—Å—Ç–Ω–æ–π –≤—Å–µ–º —Ñ—É–Ω–∫—Ü–∏–∏ `concat` —Å–ø–æ—Å–æ–±–Ω–æ–π –æ–±—ä–µ–¥–∏–Ω–∏—Ç—å –Ω–µ —Ç–æ–ª—å–∫–æ –º–∞—Å—Å–∏–≤—ã, –Ω–æ –∏ –∫–æ—Ä—Ç–µ–∂–∏.

`````ts
type A = readonly unknown[];

function concat<T extends A, U extends A>(a: T, b: U): [...T, ...U] {
    return [...a, ...b];
}

// let v0: number[]
let v0 = concat([0, 1], [2, 3]);

// let v1: [0, 1, 2, 3]
let v1 = concat([0, 1] as const, [2, 3] as const);

// let v2: [0, 1, ...number[]]
let v2 = concat([0, 1] as const, [2, 3]);

// let v3: number[]
let v3 = concat([0, 1], [2, 3] as const);
`````

–ù–∞–ø–æ—Å–ª–µ–¥–æ–∫ —Å—Ç–æ–∏—Ç —É–ø–æ–º—è–Ω—É—Ç—å, —á—Ç–æ –≤—ã–≤–æ–¥ —Ç–∏–ø–æ–≤ —Ä–∞—Å—Ü–µ–Ω–∏–≤–∞–µ—Ç `readonly` –º–∞—Å—Å–∏–≤ –∫–∞–∫ –ø—Ä–∏–Ω–∞–¥–ª–µ–∂–∞—â–∏–π –∫ –∏–Ω—Ç–µ—Ä—Ñ–µ–π—Å—É `ReadonlyArray<T>`, —Ä–µ—á—å –æ –∫–æ—Ç–æ—Ä–æ–º –ø–æ–π–¥–µ—Ç –¥–∞–ª–µ–µ.
